.sys-menu-dialog {
  margin-top: 20px !important;
}

.menu-icon-container {
  padding: 0px 10px;
}

.menu-icon-container .icon-list {
  /*border: 1px solid red;*/
  /*font-size: 30px;*/
  overflow: hidden;
  list-style: none;
  padding: 0 !important;
  border: 1px solid #eaeefb;
  border-radius: 4px;
}

.menu-icon-container .icon-list li {
  float: left;
  text-align: center;
  line-height: 30px;
  color: #666;
  font-size: 13px;
  /*border-right: 1px solid #eee;*/
  /*border-bottom: 1px solid #eee;*/
  margin-right: -1px;
  margin-bottom: -1px;
}

.menu-icon-container .icon-list li span {
  width: 40px;
  height: 40px;
  line-height: 40px;
  display: inline-block;
  vertical-align: middle;
  font-size: 20px;
}

.menu-icon-container .icon-list li i:hover {
  color: #1890ff;
  font-size: 25px;
}
